from collections import defaultdict, deque

def parse_input(k, d, paired_reads):
    # Create a list of paired k-mers
    paired_kmers = [tuple(pair.split('|')) for pair in paired_reads]
    return k, d, paired_kmers

def build_de_bruijn_graph(paired_kmers):
    graph = defaultdict(list)
    in_degree = defaultdict(int)
    out_degree = defaultdict(int)
    
    for prefix, suffix in paired_kmers:
        prefix_node = (prefix[:-1], suffix[:-1])
        suffix_node = (prefix[1:], suffix[1:])
        graph[prefix_node].append(suffix_node)
        out_degree[prefix_node] += 1
        in_degree[suffix_node] += 1
    
    return graph, in_degree, out_degree

def find_eulerian_path(graph, in_degree, out_degree):
    start_node = None
    end_node = None
    
    for node in set(in_degree) | set(out_degree):
        if out_degree[node] > in_degree[node]:
            start_node = node
        if in_degree[node] > out_degree[node]:
            end_node = node
    
    if start_node is None:
        start_node = next(iter(graph.keys()))
    
    stack = [start_node]
    path = []
    
    while stack:
        u = stack[-1]
        if u in graph and graph[u]:
            v = graph[u].pop()
            stack.append(v)
        else:
            path.append(stack.pop())
    
    return path[::-1]

def reconstruct_string(path, k, d):
    prefix_string = path[0][0]
    suffix_string = path[0][1]
    
    for node in path[1:]:
        prefix_string += node[0][-1]
        suffix_string += node[1][-1]
    
    return prefix_string + suffix_string[-(k+d):]

def string_reconstruction(k, d, paired_reads):
    k, d, paired_kmers = parse_input(k, d, paired_reads)
    graph, in_degree, out_degree = build_de_bruijn_graph(paired_kmers)
    eulerian_path = find_eulerian_path(graph, in_degree, out_degree)
    return reconstruct_string(eulerian_path, k, d)

